import React from "react";
import { Button, ButtonGroup } from "reactstrap";

const Linksr3 = props => {
  return (
    <ButtonGroup size="lg">
      <Button>Access Plan Info</Button>
      <Button>Contact Us</Button>
    </ButtonGroup>
  );
};

export default Linksr3;
